  display: flex;
  align-items: center;
  position: relative;
  cursor: pointer;
`;

const NotiChild = styled.span`
  position: absolute;
  top: -15px;
  right: -20px;
  background-color: red;
  color: white;
  font-size: 12px;
  padding: 2px 5px;
